import { SelectCourseCategoryService } from './select-course-category.service'
export default {
  name: 'StSelectCourseCategory',
  serviceInject() {
    return {
      selectCourseCategoryService: SelectCourseCategoryService
    }
  },
  props: {
    value: {
      type: Number,
      default: -1
    }
  },
  data() {
    return {
      list: []
    }
  },
  created() {
    this.selectCourseCategoryService.getCourseCategoryList().subscribe(res => {
      this.list = res.list
    })
  },
  methods: {
    change(val) {
      this.$emit('change', val)
    }
  }
}
